window.bookSummaryJSON = "The plan was simple, step into Hell, Find some infected roots, try my hand at fixing them, And then it was well done Amelia, you saved the day! But I didn’t bargain on a few factors set against me, The most obvious being that this…well this was Hell. And in this realm of Hell there were rules, there was a hierarchy and as for me, I was at the bottom of it. A dangerous place to be, especially when the man at the top was known as a tyrant king. A heartless, cold and ruthless ruler. Oh, and one more thing…he just so happened to be my boyfriend. And he was…furious with me."; 
